import React from "react";
import logo1 from "../Dish1.jpg";
import logo2 from "../Dish2.jpg";
import logo3 from "../Dish3.jpg";
function HomePage() {
  return (
    <div style={{ marginTop: "10px", textAlign: "center" }}>
      <h5 style={{ textAlign: "center" }}>
        "The person, be it gentleman or lady, who has not pleasure in a good
        novel, must be intolerably stupid"
      </h5>
      <p style={{ textAlign: "center" }}>
        Kitchen Stories is a food network kitchen application that helps you to
        make a delicious meal each and every time with step-by-step
        process.Let's start preparing the meals!
      </p>
      <img
        src={logo1}
        style={{ width: "30%", paddingLeft: "135px", height: "30%" }}
      />
      <img
        src={logo2}
        style={{ width: "38%", paddingLeft: "10px", height: "38%" }}
      />
      <img
        src={logo3}
        style={{ width: "30%", paddingLeft: "10px", height: "30%" }}
      />
    </div>
  );
}

export default HomePage;
